
"""
# Knight Dialer

The chess knight has a **unique movement**, it may move two squares vertically and one square horizontally, or two squares horizontally and one square vertically (with both forming the shape of an **L**). The possible movements of chess knight are shown in this diagaram:

A chess knight can move as indicated in the chess diagram below:
![935_chess](./img/935_chess.jpg)

We have a chess knight and a phone pad as shown below, the knight can only stand on a numeric cell (i.e. blue cell).
![935_phone](./img/935_phone.jpg)

Given an integer `n`, return how many distinct phone numbers of length `n` we can dial.

You are allowed to place the knight **on any numeric cell** initially and then you should perform `n - 1` jumps to dial a number of length `n`. All jumps should be **valid** knight jumps.

As the answer may be very large, **return the answer modulo** `10^9 + 7`.


**Example 1:** 
```
Input: n = 1
Output: 10
Explanation: We need to dial a number of length 1, so placing the knight over any numeric cell of the 10 cells is sufficient.
```

**Example 2:** 
```
Input: n = 2
Output: 20
Explanation: All the valid number we can dial are [04, 06, 16, 18, 27, 29, 34, 38, 40, 43, 49, 60, 61, 67, 72, 76, 81, 83, 92, 94]
```

**Example 3:** 
```
Input: n = 3131
Output: 136006598
Explanation: Please take care of the mod.
```

**Constraints:** 
    - `1 <= n <= 5000` 
"""

import unittest
from random import sample

class Solution:
    def knightDialer(self, n: int) -> int:
        """
        Dynamic programming approach

        dp[i][d] <- The number of phone numbers that are ended with digit d and are of length (i + 1), 
                    where i = 0, 1, ..., n - 1 and d is in [0, 9].

        Base case: dp[0][d] is 1 for all d.
        """
        moves = {
            0: [4, 6], 1: [6, 8], 2: [7, 9], 3: [4, 8], 4: [0, 3, 9], 
            5: [], 6: [0, 1, 7], 7: [2, 6], 8: [1, 3], 9: [2, 4]
        }
        dp, MOD = [[1] * 10] + [[0] * 10 for _ in range(n - 1)], 10 ** 9 + 7
        for i in range(n - 1):
            for digit in range(10):
                for nxt_move in moves[digit]:
                    dp[i + 1][nxt_move] += dp[i][digit]
                    dp[i + 1][nxt_move] %= MOD
        return sum(dp[-1]) % MOD


